import { useEffect } from 'react';

setupServer();

const { Title } = Typography;

function App() {

    return (
        <div className="app-container">
            <Title style={{ textAlign: 'center' }}>MINI TODOS</Title>
            <Filters />
            <Divider />
            <TodoList />
        </div>
    );
}

export default App;
